    <!-- генератор карты -->
    <script>
      ;(function(window) {
        window.MapGenerator = function(selector, animationType) { // конструктор класса
          function getRandom() {
            let random = Math.round(Math.random() * 10000);
            if (random > 900 && random < 9000) {
              return random
            } else {
              return getRandom()
            }
          }

          function init(elem, width) {
            elem.style.width = width + 'px';
            elem.style.height = width * 0.45763 + 'px';
            map.width = width;
            map.height = width * 0.45763;
            map.latitude = map.height / 139.33;
            map.longitude = map.width / 360;
            map.element = elem;
            map.startAsix = {
              latitude: map.latitude * 30.6 * Math.E,
              longitude: map.longitude * 61.7 * Math.E,
            };
            map.maxDotSize = width * 0.0078194;
            elem.style.backgroundSize = map.width + 'px ' + map.height + 'px';
          }

          function dotId() { // генерирование id
            let text = "";
            let possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz";
            for (let i = 0; i < 10; i++)
              text += possible.charAt(Math.floor(Math.random() * possible.length));
            return text;
          }

          function getCoordinate(val, type) { // получение координаты
            if (type === 'latitude') {
              return Math.round(map.startAsix[type] - (val * map[type])) + 'px';
            } else {
              return Math.round(map.startAsix[type] + (val * map[type])) + 'px';
            }
          }

          function defineColors(type, dot, duration) { //установка цвета в зависимости от типа
            let rgbColor;
            switch (type) {
              case 'verif':
                duration = duration || '1';
                rgbColor = '255, 79, 248';
                break;
              case 'core':
                duration = duration || '3';
                rgbColor = '255, 214, 0';
                break;
              case 'proxy':
                duration = duration || '1';
                rgbColor = '0, 209, 255';
                break;
              case 'torrent':
                duration = duration || '2';
                rgbColor = '255, 214, 0';
                break;
              default:
                duration = duration || '2';
                rgbColor = '57, 201, 72';
                break;
            }
            keyFrameText = `.${dot.id} {animation: ${dot.id} ${map.randomAnimation ? duration : '5'}s infinite;} @keyframes ${dot.id} {0% {box-shadow: 0 0 0 0 rgba(${rgbColor}, 0.5);}70% {box-shadow: 0 0 0 ${Math.round(dot.size * 5)}px rgba(${rgbColor}, 0);}100% {box-shadow: 0 0 0 0 rgba(${rgbColor}, 0);}}`;
            dot.keyFrameText = keyFrameText;
            dot.color = `rgb(${rgbColor})`;
          }

          function setAnimation(index) {
            if (!map.dots[index].type) {
              defineColors(map.dots[index].type, map.dots[index]);
            }
            let frame = document.createElement('STYLE');
            frame.innerText = map.dots[index].keyFrameText;
            let allStyles = document.querySelectorAll(`#${map.id} .${map.dots[index].id} style`);
            for (let i = 0; i < allStyles.length; i++) {
              allStyles[i].remove();
            }
            map.dots[index].element.appendChild(frame);
          }

          let map = { // будующий класс
            id: dotId(), // id может понадобится в будущем
            dots: [], // массив с точками
            randomAnimation: animationType === 'random',
            /*
              инициализация
              1 - создается карта и инжектится в елемент , селектор которого был передан в качестве аргумента в конструктор
              2 - расчитывается высота карты и константы масштабов
             */
            init: function(width) {
              let backgroundImg = document.createElement('DIV');
              backgroundImg.classList.add('map-background');
              backgroundImg.setAttribute('id', map.id);
              init(backgroundImg, width);
              map.parent = {
                element: document.querySelector(selector)
              };
              map.parent.element.style.position = 'relative';
              map.parent.element.appendChild(backgroundImg);
              window.addEventListener('resize', map.events.onResize);
            },
            /*
              создание точки
              latitude - широта. обязательные параметры
              longitude - долгота. обязательные параметры
              size - диаметр. обязательные параметры
              type - тип точки (влияет на цвет) возможные варианты: [ 'peer', 'core', 'slave' ], дефолт - зеленый цвет. необязательные парамерты
              animationDuration - длительность анимации, будут игнорироваться дефолтные параметры. необязательные парамерты
              animationStartDelay - задержка перед началом анимации (будет игнорироваться дефолтное поведение). необязательные парамерты

              функция возврашает точку , которую создает.
             */
            createDot: function(latitude, longitude, size, type, animationDuration) {
              let dot = {
                __index: map.dots.length,
                id: dotId(),
                element: document.createElement('SPAN'),
                centerOffset: size / 2,
                type: type,
                size: Math.round(size),
                latitude: latitude,
                longitude: longitude
              };
              defineColors(type, dot);
              dot.element.classList.add('dot');
              dot.element.classList.add(dot.id);
              dot.element.style.width = Math.round(size) + 'px';
              dot.element.style.height = Math.round(size) + 'px';
              dot.element.style.background = dot.color;
              dot.element.style.top = getCoordinate(latitude, 'latitude');
              dot.element.style.left = getCoordinate(longitude, 'longitude');
              map.element.appendChild(dot.element);
              map.dots.push(dot);
              dot.left = parseInt(dot.element.style.left);
              if (map.randomAnimation) {
                setTimeout(function() {
                  setAnimation(dot.__index)
                }, getRandom())
              }
              return dot
            },
            /*
              удаление точки
             */
            deleteDot: function(dot) {
              map.dots.splice(dot.__index, 1);
              let deletedDot = document.getElementsByClassName(dot.id)[0];
              deletedDot.remove();
            },
            changeDotPosition: function(dot, latitude, longitude) {
              map.dots[dot.__index].element.style.top = getCoordinate(latitude, 'latitude');
              map.dots[dot.__index].element.style.left = getCoordinate(longitude, 'longitude');
            },
            events: {
              onResize: function(e) {
                let resizeTimer;
                if (resizeTimer) {
                  clearTimeout(resizeTimer);
                }
                resizeTimer = setTimeout(map.refresh, 500);
              }
            },
            resizing: null,
            setLeftToRightAnimation: function() {
              map.dots.sort(function(a, b) {
                return a.left - b.left
              });
              map.dots.forEach(function(dot, i) {
                dot.__index = i;
              });

              let counter = 0;
              map.interval = setInterval(function() {
                if (map.dots[counter]) {
                  setAnimation(counter);
                  counter++
                } else {
                  clearInterval(map.interval)
                }
              }, Math.round(map.randomAnimation ? 1000 :(5000 / map.dots.length)))
            },
            clearAnimation: function() {
              if (map.interval) {
                clearInterval(map.interval);
                let allStyles = document.querySelectorAll(`#${map.id} style`);
                for (let i = 0; i < allStyles.length; i++) {
                  allStyles[i].remove();
                }
              }
            },
            refresh: function() {
              let width = map.parent.element.offsetWidth;
              map.clearAnimation();
              init(map.element, width);
              map.dots.forEach(function(dot) {
                map.changeDotPosition(dot, dot.latitude, dot.longitude);
              });
              map.setLeftToRightAnimation();
            }
          };
          return map
        }
      })(window);
    </script>
